import React from 'react';
import Card from "./Card.js"

const cardlist = ({robots2} )=> {

    return(
        <div>
            {
                robots2.map( (user,i)=>{
                    return <Card key={robots2[i].id} id={robots2[i].id} hello name2={robots2[i].images.small} />
                } )
            }
        </div>
    )
}

export default cardlist
